Game Description:
******************
The sequel to the great and extremely popular game is here! The Egyptian ruler, Cleopatra, who is celebrated for her beauty and intelligence, reveals her mysteries to you. Take part in this addictive and thrilling jewel adventure and discover Cleopatra's treasures!
The game task is to destroy all stone tiles. Form the chain of three or more figures of the same color by clicking at one figure and drag to other adjacent figures of the same color and all of them will disappear. If there is a stone tile under the figure from the chain it will be destroyed. Enjoy the excellent graphics, melodious music, numerous levels, and unique fun bonuses in this terrific matching puzzle game!

Game Features:
***************
80 levels;
9 bonuses;
Full-screen mode;
Autosave;

